INSERT INTO [dbo].[PG_ArticlesSet] ([article_Id], [title], [abstractText], [keywords], [year], [country], [authors], [organizations], [url], [Terms_Vocabulary_terms_Id]) VALUES (11596, N'  Mutual coupling of elliptical microstrip resonators ', N'  W artykule przedstawiono wyniki badań dotyczących wzajemnych sprzężeń w mikropaskowych promiennikach w kształcie prostokąta lub elipsy. W badaniach została wykorzystana dwuwymiarowa metoda przestrzeni widmowej, w której analizowane struktury oświetlane są pojedynczą falą płaską. ', N'  MICROSTRIP RESONATORS MUTUAL COUPLING SPECTRAL DOMAIN APPROACH  ', 2012, N'   ', N'  Włodzimierz Zieniutycz   ', N'  Katedra Inżynierii Mikrofalowej i Antenowej  ', N'  http://ieeexplore.ieee.org/stamp/stamp.jsp?tp=&arnumber=6206137 ', 0)
INSERT INTO [dbo].[PG_ArticlesSet] ([article_Id], [title], [abstractText], [keywords], [year], [country], [authors], [organizations], [url], [Terms_Vocabulary_terms_Id]) VALUES (11597, N'  Minimum length path decompositions ', N'  W pracy podejmujemy problem obliczania ścieżkowych dekompozycji grafu minimalizując jednocześnie jej szerokość oraz długuść. Pokazujemy, że problem znalezienia dekompozycji o minimalnej długości i o szerokości równej co najmniej 4 jest NP-zupełny. Z drugiej strony, podajemy wielomianowy algorytm obliczania dekompozycji o minimalnej długości i szerokości wynoszącej co najwyżej 3. ', N'  ALGORYTMICZNA TEORIA GRAFÓW PRZESZUKIWANIE GRAFÓW ZŁOŻONOŚĆ OBLICZENIOWA  ', 2012, N'  Polska ', N'  Dariusz Dereniowski  Wiesław Kubiak  Yori Zwols   ', N'  Katedra Algorytmów i Modelowania Systemów  ', N'   ', 0)
