INSERT INTO [dbo].[PG_ArticlesSet] ([article_Id], [title], [abstractText], [keywords], [year], [country], [authors], [organizations], [url], [Terms_Vocabulary_terms_Id]) VALUES (11600, N'  Fatigue resistance of laser welds - latest development ', N'  Zapewnienie bezpieczeństwa konstrukcji stalowych paneli typu sandwich wymaga analizy trwałości zmęczeniowej spoin łączących poszycia z usztywnieniami. Spoiny te charakteryzuje nietypowa geometria, a także własności materiałowe. W referacie prezentowane są najnowsze osiągnięcia w obszarze badań prowadzonych nad oceną trwałości zmęczeniowej spoin laserowych. ', N'  FATIGUE LASER WELDS SANDWICH SPOINY LASEROWE ZMĘCZENIE  ', 2012, N'  Dania ', N'  Karol Niklas   ', N'  Katedra Technologii Obiekt.Pływaj.,Syst.Jak.i Mate  ', N'  http://research.dnv.com/NMUnivDNV ', 0)
