INSERT INTO [dbo].[PG_ArticlesSet] ([article_Id], [title], [abstractText], [keywords], [year], [country], [authors], [organizations], [url], [Terms_Vocabulary_terms_Id]) VALUES (11602, N'  Aplikacja programu AutoCAD wspomagająca proces inwentaryzacji elementów zastosowanych w projekcie instalacji elektrycznej ', N'  W artykule opisano zagadnienia dotyczące zastosowania programu AutoCAD jako narzędzia wspomagającego proces inwentaryzacji elementów zastosowanych w projekcie instalacji elektrycznej. Do tego celu opracowano aplikację w środowisku programistycznym AutoLISP, integrowanym z programem AutoCAD. Opracowana aplikacja dokonuje analizy projektu instalacji elektrycznej, na podstawie której wyodrębniane są nazwy symboli (bloków) zastosowanych w projekcie oraz ich liczba. Wynikiem końcowym pracy  opracowanej aplikacji jest tabelka zawierająca spis wszystkich nazw, ich symboli graficznych i ich liczby występowania w projekcie. ', N'  INSTALACJE ELEKTRYCZNE KOMPUTEROWE WSPOMAGANIE PROJEKTOWANIA  ', 2012, N'  Polska ', N'  Grzegorz Kostro   ', N'  Katedra Energoelektroniki i Maszyn Elektrycznych  ', N'  http://www.innowrota.pl/sites/default/files/images/G.Kostro_1.pdf ', 0)
