INSERT INTO [dbo].[PG_ArticlesSet] ([article_Id], [title], [abstractText], [keywords], [year], [country], [authors], [organizations], [url], [Terms_Vocabulary_terms_Id]) VALUES (11606, N'  Optymalizacja: sztuka czy rzemiosło? ', N'  W pracy przedstawiono  przyczyny  niewielkiego zainteresowania zastosowaniem optymalizacji w praktyce inżynierskiej oraz przykłady jej skutecznego zastosowania. Wyciągnięto wniosek, że  najskuteczniejszym sposobem spopularyzowania  tego narzędzia jest  tworzenie specjalistycznego oprogramowania wykorzystującego inżynierską wiedzę ekspercką. ', N'  OPTYMALIZACJA OPTYMALIZACJA INŻYNIERSKA POLIOPTYMALIZACJA  ', 2012, N'  Polska ', N'  Szymon Grymek  Tomasz Kiczkowiak   ', N'  Katedra Konstrukcji Maszyn i Pojazdów  ', N'   ', 0)
