INSERT INTO [dbo].[PG_ArticlesSet] ([article_Id], [title], [abstractText], [keywords], [year], [country], [authors], [organizations], [url], [Terms_Vocabulary_terms_Id]) VALUES (11608, N'  Nieliniowa teoria i analiza deformacji i stateczności warstwowych powłok kompozytowych metodą elementów skończonych ', N'  W sprawozdaniu przedstawiono wyniki prac naukowo-badawczych powstałych w ramach projektu badawczego ''''Nieliniowa teoria i analiza deformacji i stateczności warstwowych powłok kompozytowych metodą elementów skończonych'''' N N506 254237 finansowanego przez Narodowe Centrum Nauki w latach 2009-2012.Wyniki badań  przedstawiono w 33 pracach: 2 monografiach (W. Witkowski 2011 i A. Sabik 2012), 1 rozprawie doktorskiej (A. Sabik 2012), 9 publikacjach w czołowych czasopismach międzynarodowych z listy filadelfijskiej (3 prace w Z. Angew. Math. Mech., 2 prace w International Journal of Solids and Structures, po jednej pracy w Applied Mathematical Modelling, Mechanics of Advanced Materials and Structures, Archives of Civil and Mechanical Engineering.  Opublikowano 5 prac w innych naukowych czasopismach recenzowanych oraz 4 prace w książkach. Przygotowano 8 streszczeń referatów konferencyjnych, 2 opracowania wewnętrzne oraz w znaczącym stopniu zaawansowano dwie rozprawy doktorskie. ', N'  MATERIAŁY KOMPOZYTOWE METODA ELEMENTÓW SKOŃCZONYCH POWŁOKI WARSTWOWE STATECZNOŚĆ  ', 2012, N'  Polska ', N'  Jacek Chróścielwski  Wojciech Witkowski   ', N'  Katedra Mechaniki Budowli  ', N'   ', 0)
