INSERT INTO [dbo].[PG_ArticlesSet] ([article_Id], [title], [abstractText], [keywords], [year], [country], [authors], [organizations], [url], [Terms_Vocabulary_terms_Id]) VALUES (11610, N'  Układ urbanistyczny śródmieścia Gdyni ', N'  Redakcja całości ekspertyzy opracowanej przez następujących autorów: Robert Hirsch, Lewicki Jakub, Maria J. Sołtysik. Tematem ekspertyzy jest układ urbanistyczny śródmieścia Gdyni wpisany do rejestru zabytków w 2007 r. ', N'  GDYNIA KONSERWACJA ZABYTKÓW MODERNIZM OCHRONA ZABYTKÓW ZABYTKI  ', 2012, N'  Polska ', N'  Robert Hirsch   ', N'  Katedra Historii,Teorii Archit.i Konserw. Zabytków  ', N'   ', 0)
INSERT INTO [dbo].[PG_ArticlesSet] ([article_Id], [title], [abstractText], [keywords], [year], [country], [authors], [organizations], [url], [Terms_Vocabulary_terms_Id]) VALUES (11611, N'  Czysta teoria prawa Hansa Kelsena a szkoła marburska ', N'  Celem artykułu jest przdstawienie czystej teorii prawa Hansa Kelsena jako jednego z teoretycznych dokonań przeprowadzonych według metody szkoły marburskiej - dokonania w stosunku do pozycji teoretycznych szkoły oryginalnego i samodzielnego. Tekst pokazuje autonomię prawa w ujęciu Kelsena, jego niezależność od wszelkich socjologicznych, etycznych i innych źródeł : prawo ma swoje źródło w samym, odsłania normatywny charakter prawa jako rzeczywistości pozaempirycznej. ', N'  FILOZOFIA TRANSCENDENTALNA, FILOZOFIA PRAWA, CZYSTA FILOZOFIA PRAWA KELSEN, SZKOŁA MARBURSKA, NEOKANTYZM,  ', 2013, N'  Polska ', N'  Andrzej Lisak   ', N'  Katedra Nauk Społecznych i Filozoficznych  ', N'   ', 0)
