INSERT INTO [dbo].[PG_ArticlesSet] ([article_Id], [title], [abstractText], [keywords], [year], [country], [authors], [organizations], [url], [Terms_Vocabulary_terms_Id]) VALUES (11613, N'  Metody analizy obiektowej w badanich środowiska morskiego ', N'  Monografia przedstawia metody klasyfikacji obrazów opierające się na analizie obiektowej. Autorzy prezentują wyniki eksperymentu dające podstawy do oceny analizy obiektowej jako konkurencyjne do klasyfikacji prowadzonej przez człowieka metodami manualnymi. ', N'  GEODEZJA MORSKA GEOMATYKA SYSTEMY INFORMACJI PRZESTRZENNEJ TELEDETEKCJA  ', 2012, N'  Polska ', N'  Katarzyna Mokwa  Marek Przyborski  Jerzy Pyrchla   ', N'  Katedra Geodezji  ', N'  http://www.geomatyka.eu/publikacje/isbn9788393001071/isbn9788393001071.pdf ', 0)
INSERT INTO [dbo].[PG_ArticlesSet] ([article_Id], [title], [abstractText], [keywords], [year], [country], [authors], [organizations], [url], [Terms_Vocabulary_terms_Id]) VALUES (11614, N'  Ocena zużycia ściernego materiałów stosowanych na węzły tarcia ślizgowego w endoprotezach stawu biodrowego ', N'  Autorzy zaprezentowali ocenę zużycia ściernego wybranych materiałów przeznaczonych na węzły tarcia ślizgowego w endoprotezach stawu biodrowego w oparciu o zaproponowane metody. ', N'  ENDOPROTEZY STOPY TYTANU ZUŻYCIE ŚCIERNE  ', 2012, N'  Polska ', N'  Tomasz Seramak  Katarzyna Zasińska  Beata Majkowska-Marzec   ', N'  Katedra Inżynierii Materiałowej i Spajania  ', N'   ', 0)
INSERT INTO [dbo].[PG_ArticlesSet] ([article_Id], [title], [abstractText], [keywords], [year], [country], [authors], [organizations], [url], [Terms_Vocabulary_terms_Id]) VALUES (11615, N'  Metody analizy obiektowej w badanich środowiska morskiego ', N'  Monografia przedstawia metody klasyfikacji obrazów opierające się na analizie obiektowej. Autorzy prezentują wyniki eksperymentu dające podstawy do oceny analizy obiektowej jako konkurencyjne do klasyfikacji prowadzonej przez człowieka metodami manualnymi. Autorzy: Katarzyna Mokwa, Marek Przyborski, Jerzy Pyrchla. Redaktor serii: Jakub Szulwic ', N'  GEODEZJA MORSKA GEOMATYKA SYSTEMY INFORMACJI PRZESTRZENNEJ TELEDETEKCJA  ', 2012, N'  Polska ', N'  Jakub Szulwic   ', N'  Katedra Geodezji  ', N'  http://www.geomatyka.eu/publikacje/isbn9788393001071/isbn9788393001071.pdf ', 0)
INSERT INTO [dbo].[PG_ArticlesSet] ([article_Id], [title], [abstractText], [keywords], [year], [country], [authors], [organizations], [url], [Terms_Vocabulary_terms_Id]) VALUES (11616, N'  A note on resistive models of switched-capacitor dc-dc converters: Unified incremental-graph-based formulas given ', N'  Praca przedstawia model rezystancyjny konwertera dc-dc z przełączanymi pojemnościami, uzyskany z użyciem metody grafu przyrostowego, wprowadzonej do literatury we wcześniejszych pracach autora. Podane zostały formuły na zastępcze rezystancje wyjściowe układu w trybach pracy z tzw. wolnym przełączaniem (ang. SSL) oraz szybkim przełączaniem (ang. FSL). Wprowadzono - jako nowość - wzór na wynikową rezystancję w pośrednim modzie pracy, z zastosowaniem specjalnej metryki, jako sumowanie Minkowskiego. Pracę ilustrują i wyniki potwierdzają symulacje w programie Pspice (MicroCap). ', N'  GRAF PRZYROSTOWY KONWERTERY DC-DC METRYKA MINKOWSKIEGO MODEL REZYSTANCYJNY UKŁADY C-PRZEŁĄCZANE  ', 2012, N'  Polska ', N'  Marek Makowski   ', N'  Katedra Systemów Elektroniki Morskiej  ', N'  http://ieeexplore.ieee.org/xpl/articleDetails.jsp?tp=&arnumber=6382221&contentType=Conference+Publications&searchField%3DSearch_All%26queryText%3Dmakowski%2C+A+Note ', 0)
