INSERT INTO [dbo].[PG_ArticlesSet] ([article_Id], [title], [abstractText], [keywords], [year], [country], [authors], [organizations], [url], [Terms_Vocabulary_terms_Id]) VALUES (11638, N'  Modernizacje i remonty elektrowni wodnych na rzece Gwda ', N'  Specyficzne warunki środowiskowe budowli hydrotechnicznych powodują ich szybsze starzenie się w porównaniu do innych obiektów budowlanych. Wynika z tego konieczność przeprowadzania systematycznych remontów w celu zapewnienia odpowiedniego stanu technicznego i stopnia bezpieczeństwa budowli piętrzących. W artykule przedstawiono zwięzły opis modernizacji budowli hydrotechnicznych na rz. Gwda przeprowadzonych w ostatnich latach. Pokazano stan budowli przed remontem, występujące uszkodzenia konstrukcji, przyjętą technologię naprawy oraz  budowle po przeprowadzeniu remontu. ', N'  ELEKTROWNIE WODNE ENERGETYKA ODNAWIALNA MAŁE ELEKTROWNIE WODNE  ', 2012, N'  Polska ', N'  Wojciech Szudek  Witold Sterpejkowicz-Wersocki   ', N'  Katedra Hydrotechniki  ', N'   ', 0)
