INSERT INTO [dbo].[PG_ArticlesSet] ([article_Id], [title], [abstractText], [keywords], [year], [country], [authors], [organizations], [url], [Terms_Vocabulary_terms_Id]) VALUES (11653, N'  Współpraca organizacyjna Międzynarodowego Kongresu Architektury ARCHITEKTURA I WODA ', N'  W dniach 29 kwietnia - 1 maja 2012 r. w Calvi na Korsyce, odbyła się międzynarodowa konferencja  Architektura i woda  zorganizowana przez Stowarzyszenie Architektów Polskich we Francji we wpółpracy z Wydziałem Architektury Politechniki Gdańskiej. Celem konferencji było przedstawienie problematyki związanej z różnymi aspektami wykorzystania obecności wody w kształtowaniu obiektów architektonicznych oraz struktur miejskich.  Dzięki wystąpieniom przedstawicieli różnych dziedzin możliwe było szerokie spojrzenie na omawiane zagadnienia oraz nakreślenie możliwości przekształceń miejskich terenów nadwodnych. ', N'  ARCHITEKTURA I WODA  ', 2012, N'  Francja ', N'  Janusz Gujski  Izabela Maria Burda   ', N'  Katedra Urbanistyki i Planowania Regionalnego  ', N'   ', 0)
