INSERT INTO [dbo].[PG_ArticlesSet] ([article_Id], [title], [abstractText], [keywords], [year], [country], [authors], [organizations], [url], [Terms_Vocabulary_terms_Id]) VALUES (11686, N'  Stanowisko do pomiarów i lokalizacji sygnałów akustycznych inicjowanych w procesie korozji elektrochemicznej na powierzchni ścian zbiorników ładunkowych wypełnionych ropą naftową, produktami ropochodnymi lub wodą balastową, zwłaszcza na tankowcach - Patent NR 209560 na wynalazek ', N'  Wynalazek dotyczy techniki weryfikacji stanu technicznego zbiorników ładunkowych z ropą naftową, produktami ropopochodnymi lub wodą balastową, zwłaszcza na tankowcach. Przedmiotem wynalazku jest stanowisko do pomiarów i lokalizacji sygnałów akustycznych inicjowanych w procesie korozji elektrochemicznej na powierzchni ścian zbiorników ładunkowych wypełnionych ropą naftową, produktami ropopochodnymi lub wodą balastową, zwłaszcza na tankowcach.  Stanowisko to jest wykorzystywane przez inspektorów straży granicznej, administracji morskiej do okresowego monitorowania stanu technicznego i stopnia skorodowania zbiorników ładunkowych tankowców, przebywających na akwenach morskich, przykładowo Unii Europejskiej, na redzie i w porcie. ', N'    ', 2010, N'   ', N'  Henryk Bugłacki  Wojciech Darski  Marian Borowski   ', N'   Katedra Technologii Obiekt.Pływaj.,Syst.Jak.i Mate  ', N'   ', 0)
